import {Component} from 'react'
import App from '../components/app';
import {activePage} from "../actions/actions";
import {connect} from 'react-redux'
import signUpSvg from '../public/media/undraw_fill_forms_yltj.svg';
class SignUp extends Component {

    componentWillMount() {
        this.props.dispatch(activePage('sign-up'))
    }

    render() {
        return (
            <App>
                <section className="py-4">
                    <div className="container">
                        <div className="row">
                            <div className="col-6">
                                <h2 className="display-2">تسجيل جديد</h2>
                            </div>
                            <div className="col-6">
                                <img src={signUpSvg} className={"w-100"} />
                            </div>

                        </div>
                    </div>
                </section>
            </App>
        )
    }
}

const mapStateToProps = state => {
    return {
        ...state
    }
}

export default connect(mapStateToProps)(SignUp)
